import ReactDOM from "react-dom";

function Card(){
    return(
        <>
        <div className="cards">
          <div className="card">
             <img src="https://wallpapercave.com/w/wp9418623.jpg" alt="myPic" className="card_img"/>
               <div className="card_info">
                  <span className="card_category"> ANetflix Original Series </span>
                    <h3 className="card_title"> MONEY HEIST </h3>
                      <a href="https://www.netflix.com/in/title/80990668?source=35" target="_blank"> </a>
                        <button> Watch Now </button>
               </div>
          </div>
        </div>
        {/* <input type="text" value="piyush"/>  */}
    </>
    );
}
ReactDOM.render(
    <>

    <Card imgsrc/>
    <Card/>
    <Card/>
    </>,
    document.getElementById('root')
)
